import React from 'react';
import './App.css';


function App() {
  return (
    <div className="App">
      <h1>Covid-19 Tracker</h1>
      <FormControl className="app__dropdown">
        <Select
          variant= "outlined" value="Abc">
            <Menuitem value = "worldwide">Worldwide</Menuitem>
            <Menuitem value = "worldwide">Worldwide</Menuitem>
            <Menuitem value = "worldwide">Worldwide</Menuitem>
            <Menuitem value = "worldwide">Worldwide</Menuitem>
        </Select>

      </FormControl>




    </div>
  );
}

export default App;
